const rootReducer = (state, action) => {
    switch (action.type) {
        case 'login':
            return { ...state, user: action.user, coliving: action.user }
        case 'logout':
            return { ...state, user: null }
        case 'editprofile':
            return { ...state, user: action.user };
        case 'services':
            return { ...state, services: action.services };
        case 'reservations':
            return { ...state, reservations: action.reservations };
        case 'rating-colivers':
            return { ...state, rating: action.ratingColivers }
        case 'rating-colivings':
            return { ...state, rating: action.ratingColivings }
        case 'coliving':
            return { ...state, coliving: action.coliving }
        default:
            return state
    }
}

export default rootReducer
